import React, { Component } from 'react';


class Info extends Component {

  render() {
    const Button = this.props.Button;
    return (
      <div>
        <label style={{backgroundColor: "#f00"}} htmlFor="player1">Player 1</label>
        <input onKeyUp={this.props.onKeyUpInput} type="text" id="player1"/>
        <br/>
        <label style={{backgroundColor: "#0f0"}} htmlFor="player2">Player 2</label>
        <input onKeyUp={this.props.onKeyUpInput} type="text" id="player2"/>
        <br/>
        <Button onClick={this.props.onClickStartButton}>Start playing</Button>
      </div>
    )
  }
} 

export default Info;
